import React from "react";
import { Typography, Button, Card, CardActions, CardContent, CssBaseline, Grid, Container, CardMedia, Box } from '@material-ui/core'

import useStyles from "./styles";
const cards = [1,2,3,4,5,6,7,8,9]

const ParticipantFilter = () => {
    const classes = useStyles();
    return (
        <Box>
            <Container className={classes.container} maxWidth="md">
                <Grid container spacing={4}>
                    {cards.map((card) => (
                        <Grid item key={card} xs={12} sm={6} md={4}>
                            <Card className={classes.card}>
                                <CardMedia 
                                    className = {classes.cardMedia}
                                    image="https://source.unsplash.com/random"
                                    title="Image title"
                                />
                                <CardContent className={classes.cardContent}>
                                    <Typography variant="h5">
                                        Heading
                                    </Typography>
                                    <Typography>
                                        This is a media card. You can describe the content here
                                    </Typography>
                                </CardContent>
                                <CardActions>
                                    <Button size="small" color="primary">View</Button>
                                    <Button size="small" color="primary">View</Button>
                                </CardActions>
                            </Card>
                        </Grid>
                    ))}
                </Grid>
            </Container>
        </Box>
    );
}
export default ParticipantFilter;
